import React from "react"

class GithubContact extends React.Component {
    render() {
        return (
            <div>
            	<a class="github" target="_blank" href="https://github.com/dhennigh">
            	<i class="fab fa-github-square"></i>
            	</a>
            </div>
        )
    }
}

export default GithubContact
